DROP TABLE IF EXISTS APPOINTMENTS;
DROP TABLE IF EXISTS PATIENTS;
DROP TABLE IF EXISTS DOCTORS_LOCATIONS;
DROP TABLE IF EXISTS LOCATIONS;
DROP TABLE IF EXISTS DOCTORS;

CREATE TABLE DOCTORS (
	doctor_id INT(11) NOT NULL AUTO_INCREMENT,
	title VARCHAR(255) NOT NULL,
	first_name VARCHAR(255) NOT NULL,
	last_name VARCHAR(255) NOT NULL,
	degree VARCHAR(255) NOT NULL,
	PRIMARY KEY (doctor_id)
);


CREATE TABLE LOCATIONS (
	location_id INT(11) NOT NULL AUTO_INCREMENT,
	label VARCHAR(255) NOT NULL UNIQUE,
	street1 VARCHAR(255) NOT NULL,
	street2 VARCHAR(255),
	city VARCHAR(255) NOT NULL,
	state VARCHAR(255) NOT NULL,
	zip VARCHAR(255) NOT NULL,
	phone VARCHAR(255) NOT NULL,
	PRIMARY KEY (location_id)
);


CREATE TABLE DOCTORS_LOCATIONS (
	id INT(11) NOT NULL AUTO_INCREMENT,
	doctor_id INT(11) NOT NULL,
	location_id INT(11) NOT NULL,
	PRIMARY KEY (id),
	FOREIGN KEY (doctor_id) REFERENCES DOCTORS(doctor_id),
	FOREIGN KEY (location_id) REFERENCES LOCATIONS(location_id)
);


CREATE TABLE PATIENTS (
	patient_id INT(11) NOT NULL AUTO_INCREMENT,
	first_name VARCHAR(255) NOT NULL,
	last_name VARCHAR(255) NOT NULL,
	birthdate DATE NOT NULL,
	email VARCHAR(255) NOT NULL,
	phone VARCHAR(255) NOT NULL,
	primary_doctor INT(11),
	primary_location INT(11),
	PRIMARY KEY (patient_id),
	FOREIGN KEY (primary_doctor) REFERENCES DOCTORS(doctor_id),
	FOREIGN KEY (primary_location) REFERENCES LOCATIONS(location_id)
);


CREATE TABLE APPOINTMENTS (
	appointment_id INT(11) NOT NULL AUTO_INCREMENT,
	patient_id INT(11),
	doctor_id INT(11) NOT NULL,
	location_id INT(11) NOT NULL,
	time VARCHAR(255) NOT NULL,
	year INT(11) NOT NULL,
	month INT(11) NOT NULL,
	day INT(11) NOT NULL,
	day_of_week INT(11) NOT NULL,
	chief_complaint VARCHAR(255),
	PRIMARY KEY (appointment_id),
	FOREIGN KEY (patient_id) REFERENCES PATIENTS(patient_id),
	FOREIGN KEY (doctor_id) REFERENCES DOCTORS(doctor_id),
	FOREIGN KEY (location_id) REFERENCES LOCATIONS(location_id)
);

